@kountrywayne gives a testimony about how he forgave his parents for their mistakes and how him and his father have the best relationship now. I wanted to post this because I know exactly what Wayne is talking about. It was a point in my life where I didn’t want to forgive my father for the mistakes he made. But if it wasn’t for his mistakes I wouldn’t have a story to tell. And most importantly our parents did the best they could with what they knew at the time. The Holy Quran repeats over and over how Allah hates ingratitude. We should found ourselves thankful for our parents because without them we wouldn’t be here. Salute to Wayne for this! 
